La Blue Girl Live 2-Birth of the Demon Child (1996)

The Sex Demon King, Hanzaki, attempted to enter the human world with the help of the evil Shikima Clan. However, before his dark embrace descended on humanity, the lovely ninja of the Miroku Clan, Miyu and Miko Bido, faced him in a fight to the death. The two women managed to defeat the powerful Hanzaki, but during the battle, Miyu became pregnant with his child. Now the Shikima prepare for battle once more, and this time their key to victory will be Miyu and her evil child.

